import React from "react";
import PropTypes from 'prop-types';
import { Fragment } from "react";

function Images({src, alt}) {
    return (
        <div style={{width: '100%'}}>
        <img class="card-img-top" src={src} alt={alt} style={{width: '100%', padding: '33%', background: 'silver', color: '#ffffff', fontSize: "18px", whiteSpace: 'nowrap'}} /> 
        </div>
    )
}

Images.propTypes = {
    src: PropTypes.string,
    alt: PropTypes.string
}
export default Images;
